import React, { useState } from "react";

import Box from "@material-ui/core/Box";
import Button from "@material-ui/core/Button";
import Typography from "@material-ui/core/Typography";
import AFastTable from "./aFastTable";
import ATextField from "./aTextField";
import NavigateBeforeIcon from "@material-ui/icons/NavigateBefore";
import NavigateNextIcon from "@material-ui/icons/NavigateNext";
import ASearchPaginationBar from "./aSearchPaginationBar";

const TestContentPanel3 = (props) => {
  const columnDefs = [
    {
      headerName: "ID",
      field: "id",
      sortable: true,
      sortOrder: "asc",
      filter: true,
      checkbox: true,
    },
    { headerName: "Make", field: "make", sortable: true, sortOrder: "desc" },
    { headerName: "Model", field: "model", filter: true },
    { headerName: "Price", field: "price", radio: true },
  ];

  return (
    <Box style={{ margin: "20px" }}>
      <ATextField name="search" />{" "}
      <Button variant="contained" color="primary">
        Search
      </Button>
      <Box style={{ height: "20px" }} />
      <AFastTable
        columnDefs={columnDefs}
        rowData={rowData}
        rowSelection="multiple"
      />
      <ASearchPaginationBar totalPages={13} pageNum={6} maxPages={9} />
    </Box>
  );
};
export default TestContentPanel3;
